    $('#showmoreproject').bind('click', function (e) {
        _self = $(this);
        _self.text('Loading...')
        $.ajax({
            url: "ajax/category.php"
        }).done(function(data) {
            $('#list-project-ajax').append(data);
            _self.text('Show more projects')
        });
        return false;
    });

